function NETSTAT(){
    this.est = 0;
    this.fin_w = 0;
    this.tim_w = 0;
    this.clo_w = 0;
}

NETSTAT.prototype.toString = function(){
    return "[est=" + this.est + ", tim_w=" + this.tim_w +
        ", clo_w=" + this.clo_w + ", fin_w=" + this.fin_w + "]";
};

module.exports = NETSTAT;